// Refer to the Basic Example documentation if you need to.
// (https://reacttraining.com/react-router/web/example/basic)
function App() {
  return (
    <BrowserRouter>
    <div>
    {/* <Route exact path="/" component={Books} /> */}
    {/* <Route path="/books" component={Books}/> */}
      <Nav />
      <Route exact path="/">
      <Books />
      </Route>
    </div>
    </BrowserRouter>
  );
}

export default App;
